import React, { useState, useEffect } from "react";

const Home = () => {
  const [list, setLists] = useState([]);

  useEffect(() => {
    getLists();
  }, []);

  const getLists = async () => {
    let result = await fetch("http://localhost:5000/details");
    result = await result.json();
    setLists(result);
  };
  console.warn("list", list);

  return (
    <div className="detailsList">
      <h3>STUDENT-LIST</h3>
      <ul className="">
        <li>S.No</li>
        <li>Name</li>
        <li>Roll.No</li>
        <li>Section</li>
        <li>Branch</li>
        <li>Mobile.No</li>
        <li>Father's-Name</li>
        <li>Address</li>
        <li>Collage Name</li>
      </ul>

      {list.map((item, index) => (
        <ul>
          <li>{index + 1}</li>
          <li>{item.name}</li>
          <li>{item.roll}</li>
          <li>Section</li>
          <li>Branch</li>
          <li>Mobile.No</li>
          <li>Father's-Name</li>
          <li>Address</li>
          <li>Collage Name</li>
        </ul>
      ))}
    </div>
  );
};
export default Home;
